import React, { useEffect, useState } from "react";
import style from "../Tool/Style";
import { Container, Grid, TextField, Typography, Button } from "@material-ui/core";
import { obtenerUsuarioActual } from "../../actions/UsuarioAction";

const PerfilUsuario = () => {
  const [usuario, setUsuario] = useState({
    NombreCompleto : '',
    Email: '',
    Password: '',
    ConfirmarPassword: '',
    UserName: ''
  })

  const  ingresarValoresMemoria = e => {
    const {name, value} = e.target;
    setUsuario(anterior => ({
      ...anterior,
      [name]: value
    }));
  }


  useEffect(() => {
    obtenerUsuarioActual().then(respose => {
        console.log('Esta es la data del usuairo actual', respose);
    });
  }, [])

  return (
    <Container componen="main" maxWidth="md" justity="center">
      <div style={style.paper}>
        <Typography component="h1" variant="h5">
          Perfil de Usuario
        </Typography>
      </div>

      <form style={style.form}>
        <Grid container spacing={2}>
          <Grid item xs={12} md={12}>
            <TextField
              name="NombreCompleto" value = {usuario.NombreCompleto} onChange = {ingresarValoresMemoria}
              variant="outlined"
              fullWidth
              label="Ingrese nombre y apellido"
            />
          </Grid>

          <Grid item xs={12} md={6}>
            <TextField
              name="UserName" value = {usuario.UserName} onChange = {ingresarValoresMemoria}
              variant="outlined"
              fullWidth
              label="Ingrese Username"
            />
          </Grid>

          <Grid item xs={12} md={6}>
            <TextField
              name="Email" value = {usuario.Email} onChange = {ingresarValoresMemoria}
              variant="outlined"
              fullWidth
              label="Ingrese email"
            />
          </Grid>

          <Grid item xs={12} md={6}>
            <TextField 
              name="Password" value={usuario.Password} onChange = {ingresarValoresMemoria}
              type="password"
              variant="outlined"
              fullWidth
              label="Ingrese password"
            />
          </Grid>

          <Grid item xs={12} md={6}>
            <TextField
              name="ConfirmarPassword" value={usuario.ConfirmarPassword} onChange = {ingresarValoresMemoria}
              type="password"
              variant="outlined"
              fullWidth
              label="Confirme password"
            />
          </Grid>
        </Grid>

        <Grid container justify="center">
          <Grid item xs={12} md={6}>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              size="large"
              color="primary"
              style={style.submit}
            >
              Guardar datos
            </Button>
          </Grid>
        </Grid>
      </form>
    </Container>
  );
};

export default PerfilUsuario;
